import React from 'react'

function Todo() {
    const centerStyle = {
        width: '50%',
        margin: '0 auto'
      }
    return (
        <div>
            <ul style={centerStyle} className="list-group">
                <li className="list-group-item active">TODO</li>
                <li className="list-group-item">Todo 1</li>
                <li className="list-group-item">Todo 2</li>
                <li className="list-group-item">Todo 3</li>
                <li className="list-group-item">Todo 4</li>
                <li className="list-group-item">Todo 4</li>
           </ul>
        </div>
    )
}

export default Todo
